import React from 'react';
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';
import TimelineSectionWrapper from './timeline.style';
const handleDragStart = (e) => e.preventDefault();

import name1 from 'assets/images/team/1.jpeg'
import name2 from 'assets/images/team/2.jpeg'
import name3 from 'assets/images/team/3.jpeg'
import name4 from 'assets/images/team/4.jpeg'

const responsive = {
  0: { items: 1 },
  568: { items: 3 },
  1024: { items: 4 },
};

const items = [
  <img src={name1} onDragStart={handleDragStart} role="presentation" /> ,
  <img src={name2} onDragStart={handleDragStart} role="presentation" />,
  <img src={name3} onDragStart={handleDragStart} role="presentation" />,
  <img src={name4} onDragStart={handleDragStart} role="presentation" />,
];

const Team = () => {
  return (
    <TeamSectionWrapper>
       <AliceCarousel 
        mouseTracking 
        items={items} 
        responsive={responsive} 
        paddingLeft={50}
        paddingRight={50}
        disableButtonsControls 
        />
    </TeamSectionWrapper>

  );
}

export default Team;
